import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import * as firebase from 'firebase';
// import 'bootstrap/dist/css/bootstrap.min.css';

const functions = require('firebase-functions');

exports.helloworld = functions.https.onRequest((request, response) => {
  response.send("Hello from Firebase!");
})

var firebaseConfig = {
  apiKey: "AIzaSyBJb5jz9RDFcNymRwEJtIJny7vA4Qjjyb4",
  authDomain: "sistema-ma-andrade.firebaseapp.com",
  databaseURL: "https://sistema-ma-andrade.firebaseio.com",
  projectId: "sistema-ma-andrade",
  storageBucket: "sistema-ma-andrade.appspot.com",
  messagingSenderId: "986375528338",
  appId: "1:986375528338:web:21eb7a106894a75a66eb4b",
  measurementId: "G-8ZK9563MDN"
};
// Initialize Firebase
firebase.initializeApp(firebaseConfig);
firebase.analytics();


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
